import Link from "next/link";

const linkStyle = {
    marginRight: 15
};

const Index = () =>(
    <div>
        <Link href="/about">
            <button>Go to About Page</button>
        </Link>
        <p>Hello Next.js</p>
    </div>
);

export default Index;
